{"name":"Blobbi","about":"Blobbi is a decentralized virtual pet experience built on the Nostr protocol. Unlike traditional pet apps that depend on centralized servers and closed ecosystems, Blobbi leverages the power of Nostrs open, censorship-resistant relay network to bring your digital companion to life.

By adopting a Blobbi, users enter a playful social world where interacting on Nostr posting, replying, following, and engaging with others, directly helps their Blobbi grow and evolve. Each stage of the Blobbis life unlocks new features and challenges, turning your everyday Nostr activity into a meaningful bond with your virtual pet.

Blobbi is more than a pet, its a social creature that thrives on connection.","picture":"https://www.blobbi.pet/blob.png","website":"https://www.blobbi.pet/"}
